import React from 'react';

const Planet = ({ name, climate, terrain, population }) => {
  return (
    <div>
      <h2>{name}</h2>
      <p>Climate: {climate}</p>
      <p>Terrain: {terrain}</p>
      <p>Population: {population}</p>
    </div>
  );
};

export default Planet;
